class InputText extends React.Component {    
    render() {
        console.log(this.props)
        return (
            <ul>
                {this.props.todos.map(todo =>
                    <ListItem key={todo.id.toString()}>{todo.text}</ListItem>
                )}
            </ul>
        )

    }
}

export default InputText;
